INSERT INTO FAQ (FAQ_NO, FAQ_TITLE, FAQ_CONTENT, ENROLL_DATE, MODIFY_DATE, STATUS) VALUES (SEQ_FNO.NEXTVAL,'주문 취소하면 적립금/쿠폰도 원상복구가 되나요?','주문 취소시 결제 금액 환불과 함께 적립금과 쿠폰이 원상복구 됩니다. 

다음에 주문하실 때 사용하실 수 있습니다.',to_date('12/11/2023', 'MM/DD/RRRR'),to_date('12/11/2023', 'MM/DD/RRRR'),'Y');
--행 2
INSERT INTO FAQ (FAQ_NO, FAQ_TITLE, FAQ_CONTENT, ENROLL_DATE, MODIFY_DATE, STATUS) VALUES (SEQ_FNO.NEXTVAL,'결제를 했는데 아직도 입금확인중이라고 뜹니다.','카드나 계좌이체 선택시 
고객님의 결제가 확인이 되었는데 입금 확인중이라고 뜨면, 
반드시 포마이펫 고객센터(02-1234-5678) 
또는 [1:1 문의하기]로 관련 내용을 접수해 주시기 바랍니다. 
 
무통장 입금시 입금 하시는 분의 성함이 달라도, 
계좌번호와 금액이 정확하면 입금확인이 가능하며 
초과입금을 하셨거나, 계좌번호를 잘못기재하여 입금을 하셨을 경우에는 
문의주시거나 1:1 상담에 글을 남겨주시면, 
확인 후 처리해드리도록 하겠습니다.  ',to_date('12/11/2023', 'MM/DD/RRRR'),to_date('12/11/2023', 'MM/DD/RRRR'),'Y');
--행 3
INSERT INTO FAQ (FAQ_NO, FAQ_TITLE, FAQ_CONTENT, ENROLL_DATE, MODIFY_DATE, STATUS) VALUES (SEQ_FNO.NEXTVAL,'주문한 내용이나 수령인정보를 변경하려면 어떻게 해야 하나요?','이미 주문완료 후에는 상품변경은 안되며 전체취소 후 새로 주문을 해주셔야 합니다.
상품발송 상태 이후에는 변경, 취소가 불가능합니다. 
주문을 취소하실 경우에도 가능한 빨리 의사를 표현해 주셔야 합니다. 
 
주문건의 상태가 결제전, 결제확인 상태일 경우 
먼저 고객센터(02-1234-5678)를 통해 발송 여부를 확인하여 
수령인 정보 변경 관련하여 접수해 주시면 됩니다.  ',to_date('12/11/2023', 'MM/DD/RRRR'),to_date('12/11/2023', 'MM/DD/RRRR'),'Y');
--행 4
INSERT INTO FAQ (FAQ_NO, FAQ_TITLE, FAQ_CONTENT, ENROLL_DATE, MODIFY_DATE, STATUS) VALUES (SEQ_FNO.NEXTVAL,'반품 할 상품을 직접 보내도 되나요?','반품 사유와 상품에 따라 차이가 있으니 
먼저 고객센터(02-1234-5678)에 반품 접수를 해주시고, 
접수시 안내받은 방법으로 반품 해주시기 바랍니다. 
반품접수 없이 임의로 반송한 경우 신속한 확인을 할 수 없으므로 
환불이 지연되거나 환불이 되지 않을 수 있으니 이 점 꼭 양지해 주시기 바랍니다. ',to_date('12/11/2023', 'MM/DD/RRRR'),to_date('12/11/2023', 'MM/DD/RRRR'),'Y');
--행 5
INSERT INTO FAQ (FAQ_NO, FAQ_TITLE, FAQ_CONTENT, ENROLL_DATE, MODIFY_DATE, STATUS) VALUES (SEQ_FNO.NEXTVAL,'회원ID와 패스워드를 잊어버렸어요.','ID와 Password를 잊어버렸을 경우에는, 쇼핑몰 상단의 [로그인] 버튼을 클릭하신후, 
하단에 [아이디 찾기] 또는 [비밀번호 찾기]버튼을 클릭하세요. 
절차에 따라 입력을 하시면, ID확인과 비밀번호 확인을 하실 수 있습니다. 
 
다시 로그인을 하신 후, 마이페이지에 접속하시어 
꼭 안전한 비밀번호로 새로이 변경하시는걸 권장합니다. ',to_date('12/11/2023', 'MM/DD/RRRR'),to_date('12/11/2023', 'MM/DD/RRRR'),'Y');
--행 6
INSERT INTO FAQ (FAQ_NO, FAQ_TITLE, FAQ_CONTENT, ENROLL_DATE, MODIFY_DATE, STATUS) VALUES (SEQ_FNO.NEXTVAL,'적립금은 어떻게 사용하나요?','상품 주문시, 결제창에서 적립금을  원하시는 사용금액 입력후 결제해주시면 됩니다. 
 
*적립금은 마이페이지에서 확인 가능합니다. ',to_date('12/11/2023', 'MM/DD/RRRR'),to_date('12/11/2023', 'MM/DD/RRRR'),'Y');
--행 7
INSERT INTO FAQ (FAQ_NO, FAQ_TITLE, FAQ_CONTENT, ENROLL_DATE, MODIFY_DATE, STATUS) VALUES (SEQ_FNO.NEXTVAL,'주문한상품이 품절되었다는 연락을 받았어요.','품절로 불편함을 드리게 되어 정말 죄송합니다. 
품절상품으로 인한 환불시 발생하는 배송비, 수수료는 저희 부담으로, 교환이나 환불 가능합니다. 
품절상품에 대한 환불방법은 고객님께서 결제해주신 수단으로 각각 환불 처리 도와드리고 있습니다. ',to_date('12/11/2023', 'MM/DD/RRRR'),to_date('12/11/2023', 'MM/DD/RRRR'),'Y');
--행 8
INSERT INTO FAQ (FAQ_NO, FAQ_TITLE, FAQ_CONTENT, ENROLL_DATE, MODIFY_DATE, STATUS) VALUES (SEQ_FNO.NEXTVAL,'반품 처리 기간은 어느정도 소요되나요?','택배기사님이 상품을 수거해간 후 물류센터에 도착하기까지 영업일기준 2~5일정도 소요되며 

교환/반품 양식서 처리내용이 정확히 기재된 경우 
보내주신 상품이 물류센터에 도착한 날로부터 접수/환불까지는 영업일기준 2-5일 정도 소요됩니다.',to_date('12/11/2023', 'MM/DD/RRRR'),to_date('12/11/2023', 'MM/DD/RRRR'),'Y');
--행 9
INSERT INTO FAQ (FAQ_NO, FAQ_TITLE, FAQ_CONTENT, ENROLL_DATE, MODIFY_DATE, STATUS) VALUES (SEQ_FNO.NEXTVAL,'회원정보 변경은 어떻게 하나요?','"로그인 하신 후  "내정보수정"에서 하실 수 있습니다. 
단, 배송지 정보를 변경하시기 위해서 회원정보 수정란에서 주소를 변경하시더라도 
회원정보의 주소와 배송지는 달리 취급되기 때문에, 배송지 추가/변경/삭제에 대한 처리는 
마이페이지 - 배송지 관리에서 정보 변경 해주시길 바랍니다. 
 
이미 상품을 주문하신 후 배송지를 변경하시더라도 
주문 당시에 기재하셨던 배송지는 변경되지 않으니 고객센터로 문의 주시기 바랍니다."',to_date('12/11/2023', 'MM/DD/RRRR'),to_date('12/11/2023', 'MM/DD/RRRR'),'Y');

